def crc16(byte, crc):
	byte = (byte & 255)
	crc = (crc & 65535)
	crc = ((crc >> 8) | (crc << 8))
	crc = (crc ^ byte)
	crc = (crc ^ ((crc & 255) >> 4))
	crc = (crc ^ ((crc << 8) << 4))
	crc = (crc ^ (((crc & 255) << 4) << 1))
	return (crc & 65535)

